import './Equipment.css';
import Collaborator from '../Collaborator/Collaboratos';

const Equipment = (props) => {
    const {mainColor, secondaryColor, tittle, dataCollaborator} = props; /* props list */

    const bgColor = { backgroundColor: secondaryColor };
    const bderColor = { borderColor: mainColor };

    return <section className='equipment' key = {props.tittle} style={bgColor}>
        <h3 style={bderColor} >{tittle}</h3>
        <div className='collaborators'>
            {
            dataCollaborator.map((collaborator) =>
            <Collaborator value = {collaborator} key = {collaborator}/>)
            }
        </div>
    </section>
};

export default Equipment;
